// export default winCalendar

import React from 'react';
import FullCalendar from '@fullcalendar/react'; // Import FullCalendar React component
import googleCalendarPlugin from '@fullcalendar/google-calendar'; // Import the Google Calendar plugin
import './winCalendar.css';

function winCalendar() {
    return (
        <div className="winCalendar">
            <div className="header">
                <h1>CALENDAR SECTION</h1>
            </div>
            <div id="calendar">
                <FullCalendar
                    plugins={[googleCalendarPlugin]}
                    googleCalendarApiKey="AIzaSyCNuPc8INoIhejkZ0ZpBgqxMMubNbs7Twc"
                    events={{
                        googleCalendarId: 'c_6ac1b95b43f0bc6b7729121b7f5eb6af644b44192b24c7cd2a648282e9d5df0d@group.calendar.google.com'
                    }}
                />
            </div>
        </div>
    );
}

export default winCalendar;
